import styles from './Sweet.module.scss'



function Sweet() {
    return (
     
      <div className={styles.introsection}> 
      <div className={styles.text}>
               <h3 className={styles.header}>Coś dla serduszka</h3>
            <h1 className={styles.subheader}>Zdrowe<br/>słodkości
            </h1>
            </div>
          
    
      
      </div>
     
 
    );
  }

  export default Sweet
